// Tab.js
import React from 'react';

const Tab = ({ activeTab, tabName, onClick }) => {
  const handleClick = () => {
    onClick(tabName);
  };

  return (
    <li className={activeTab === tabName ? 'active' : ''} onClick={handleClick}>
      {tabName}
    </li>
  );
};

export default Tab;
